import React from 'react';
import ContactForm from '../components/ContactForm';

const Contact = () => {
  return (
    <section>
      <ContactForm />
      <p>Email: alexiswatson622@hotmail.com</p>
      <p>Phone: (800) 123-4567</p>
    </section>
  );
};

export default Contact;
